Obviously we will have to remember how many frames the player has played. This requires another variable, and this variable should also be initialized at the outset of a game. VARIABLE SCORE
VARIABLE BONUS
VARIABLE FRAME# : START 0 SCORE ! 0 BONUS ! 0 FRAME# ! ; The frame count has to be incremented every time the player closes a frame (i.e delivers a strike or throw their second roll), but it will not go beyond 10: : FRAME#&gt; \ advance frame count FRAME# @ 1+ 10 MIN FRAME# ! ;
